window.bookSummaryJSON = "<p>I was the most powerful healer in my world—the best, having devoted my entire life to mastering the art of healing. And yet, for whatever reason, my brother feared that I sought to claim his throne, and he marshaled his forces against me.</p> <p>Anyway, it doesn't matter, all the same I'd been planning on trying out a certain ritual and now . . .</p> <p>I'm in another world altogether!? And this body I'm inhabiting, well, it's not mine, but some young guy's! And what's it mean that in this world the gift of the healer is downright pathetic?</p> <p>Apparently, they simply don't know how to handle power.</p> <p>Well, I'll show them . . .</p>"; 
